document.addEventListener("deviceready", onDeviceReady, false);

$(document).ready(function() {
    if (localStorage.getItem("darkmode") === "true") {
        $("head").append("<link rel=\"stylesheet\" href=\"dark.css\">");
        $("#logo__nav").attr("src", "logo_dark.png");
    }
    $.get("https://api.joinmastodon.org/servers?category=general", function(data) {
        $("#serverlist tbody").append("<tr><td></td><td style=\"max-width:150px;\"><b>Server</b></td><td></td></tr>");
        data.forEach(el => {
            if (el["domain"].length < 20) {
                $.get(el["proxied_thumbnail"], function(data){
                    if (Base64.encode(data) !== "") {
                        $("#serverlist tbody").append("<tr><td><img src=\""+el["proxied_thumbnail"]+"\" width=\"64\"></td><td style=\"max-width:150px;\">"+el["domain"]+"</td><td><button class=\"btn btn-primary btn-signup\" onclick=\"location.href='register.html#server="+el["domain"]+"';\">Sign up</button></tr>");
                    }
                });
            }
        });
    });

    window.setTimeout(function() {
        if (localStorage.getItem("lang") === "de") {
            $("#view__signup h1").html("Registriere dich für einen Account");
            $("#signup__intro").html("Wir können folgende Server empfehlen:");
            $("#serverlist > table > tbody > tr:nth-child(1) > td:nth-child(2) > b").html("Server");
            window.setInterval(function() {
                $(".btn-signup").html("Registrieren");
            });
        }
    },500);
});

//Cordova-specific code
function onDeviceReady() {
    if (cordova.platformId == 'android') {
        StatusBar.backgroundColorByHexString("#fff");
        StatusBar.styleDefault();
        if (localStorage.getItem("darkmode") === "true") {
            StatusBar.backgroundColorByHexString("#191919");
            StatusBar.styleLightContent();
        }
    }
}